import React, {useEffect, useState} from 'react';
import './Circle.css';




const Circle = (props) => {
    var [expand, setExpand] = useState(true);

    const shrink = () => {
        setExpand(false);
    }
    const grow = () => {
        setExpand(true);
    }

    return (<button className={expand ? "circle-container" : "circle-display"} 
                onClick={expand ? {shrink} : {grow}}>

        <b>{props.course}</b>

        </button>
    );

    // on press: become larger (w no respect for margins and large shadows)
    // ^ need to establish larger grid display first

};

export default Circle;
